CREATE DEFINER=`Hospital_programacion`@`%` FUNCTION `fn_numero_aleatorio_entre`(minimo INT, maximo INT) RETURNS int
    DETERMINISTIC
BEGIN
    DECLARE resultado INT;
    SET resultado = FLOOR(RAND() * (maximo - minimo + 1)) + minimo;
    RETURN resultado;
END ;;
